const Header = (props) => {
  console.log(props)

  return(
    <div>
      <h1>{props.course}</h1>
    </div>
  )

}

const Content = (props) => {
  console.log(props)

  return(
    <div>
      <ul>
        <Part1 part1 = {props.part1}/> 
        <Part2 part2 = {props.part2}/> 
        <Part3 part3 = {props.part3}/> 

      </ul>
    </div>
  )

}

const Total = (props) => {

  return(
    <div>
      <p>Total: {props.total}</p>
    </div>
  )
}


const App = () => {
  const course = 'Half Stack application development'
  const part1 = 'Fundamentals of React'
  const exercise1 = 10
  const part2 = 'Using props to pass data'
  const exercise2 = 7
  const part3 = 'State of a component'
  const exercise3 = 13
  const total = exercise1 + exercise2 + exercise3

return (
  <div>
    <Header course= {course}/>
    <Content part1 = {part1} exercise1 = {exercise1} part2={part2} exercise2={exercise2} part3={part3} exercise3={exercise3} />
    <Total total = {total}/>
  </div>
)

}

export default App;
